import { createMuiTheme } from '@material-ui/core';

const darkTheme = {
    palette: {
      primary: {
        main: "#282C34",
      },
      secondary: {
        main: "#8a85ff",
      },
    },
};
const lightTheme = {
    palette: {
        background: {
            default: "#1c2025"
        },
        primary: {
            main: "#eee",
        },
        secondary: {
            main: "#8a85ff",
        },
    },
};

export { darkTheme, lightTheme }
